  return (
    <div className="App">
      <div className="row"> 
      <Post title="Constant element Component" name="Dinesh" sname="Peta" /> 
      </div>
      <div className="row">
        <About name="Functional Components"/>
      </div>
      <div className="row">
        <ClassComponent/>
      </div>
    </div>
  );
}

export default App;
